import React from 'react'

const PswordUpdate = () => {
  return (
    <>
      <h1>비밀번호 재설정</h1>
      <p>가입한 이메일 주소를 입력해주세요.</p>
      <input placeholder='이메일' />
      <button>이메일 인증하기</button>
    </>
  )
}

export default PswordUpdate
